import React from 'react';
import './RollingCarousel.css';

function RollingCarousel() {


    const items = document.getElementsByClassName('rolling_item');

    // set transition
    const carousel = document.getElementsByClassName('rolling_carousel')[0];

    for (var i = 0; i < carousel.style.width; i++) {
        carousel.style.left--;
    }



    return <div className='rolling_carousel row'>
        <div className='rolling_item col'>
            <div className="align_1">

            </div>
        </div>
        <div className='rolling_item  col'>
            <div className="align_2">

            </div>

        </div>
        <div className='rolling_item  col'>
            <div className="align_3">

            </div>

        </div>
        <div className='rolling_item  col'>
            <div className="align_4">

            </div>

        </div>
        <div className='rolling_item  col'>
            <div className="align_5">

            </div>

        </div>
        <div className='rolling_item'>
            <div className="align_6">

            </div>
        </div>
    </div>;
}

export default RollingCarousel;
